  (3717, 2, 0, 0, 'Dr', 'Katrina', 'Hopper  ', 'Dr. Katrina Hopper', 'Dr. Kate Hopper graduated from The University of Melbourne, Australia in 1991, after which she spent 4 years in small animal general practice. She then returned to Melbourne University to complete a residency in emergency and critical care and a Masters in Veterinary Science. Dr. Hopper then completed a residency in emergency and critical care at the University of California, Davis and became a Diplomate of the American College of Veterinary Emergency and Critical Care in 2002. Dr. Hopper has remained at Davis where she completed her PhD and is now on Faculty. Her research interests include acid base balance, lactate metabolism and mechanical ventilation.', '', 0, '1991', NULL, '', '', 'khopper17@yahoo.com', 'approved', 0, '', 0, '2011-08-05 10:59:28', '2011-07-31 17:56:51'),
