  (3750, 2, 0, 0, 'Dr', 'Steve', 'Hill  ', 'Dr. Steve Hill', 'DVM, MS, DACVIM (SAIM)\r\nA Diplomate of the American College of Veterinary Internal Medicine, Dr. Steve Hill has broad clinical interests in all aspects of veterinary internal medicine. His special interests are gastrointestinal, hepatobiliary, pancreatic, immune-mediated, and infectious diseases as well as oncology. While at Colorado State University, Dr. Hill’s clinical research focused on infectious and zoonotic diseases. In addition, Dr. Hill has collaborated and received additional training with human gastrointestinal and infectious disease specialists. \r\nDr. Hill has authored several scientific articles and textbook chapters and he lectures at scientific meetings. He is a Clinical Assistant Professor at Western University of Health Sciences, College of Veterinary Medicine and he is on the board of the Comparative Gastroenterology Society. Dr. Hill joined the staff of the Veterinary Specialty Hospital in 1995. ', '', 0, '1991', NULL, '', '', 'steve.hill@vshsd.com', 'approved', 0, '', 0, '2011-08-05 11:00:08', '2011-08-02 22:16:16'),
