  (10362, 2, 0, 1108, 'Dr', 'Len', 'Donato', NULL, 'A 1996 graduate of the University of Pennsylvania School of Veterinary Medicine, Dr. Len Donato has successfully navigated the desire to practice exotics medicine while still pursuing ownership and clinical responsibilities for a small animal general practice. After completing his studies, Dr. Donato was an Associate Veterinarian at Rothman Animal Hospital from 1996 to 2000. His caseload included traditional and non-traditional pets. In February 2001, Dr. Donato became the owner of Radnor Veterinary Hospital. He treats dogs, cats, birds, reptiles, ferrets, rabbits, guinea pigs, rodents, amphibians, hedgehogs, sugar gliders and other non-traditional pets. Dr. Donato''s areas of interest include orthopedics, endoscopy, and wildlife & exotic pet medicine and surgery. He is also the lab animal veterinarian and IACUC committee member for St. Joseph''s University in Philadelphia, PA. He has sat as a member on the Board of Health for Radnor Township in Delaware County, PA, since 2007, and became a diplomate of the American Board of Veterinary Practitioners (Avian) in 2008.', '', 0, '1996', NULL, '', '+16106871550', 'info@radnorvet.com', 'approved', 0, '', 0, '2014-12-17 01:44:26', '2014-12-17 01:44:26'),
