  (10402, 2, 0, 865, 'Dr', 'Thea', 'Legaarden', NULL, 'Earned her doctorate of veterinary medicine (DVM) from Ontario Veterinary College (OVC) in 2003.\n\nDr. Thea Legaarden is an equine veterinarian who focuses on lameness diagnostics and performance medicine.\n\nServices Include:\nLameness Diagnosis\nPre-Purchase Exams\nDigital Imaging (Radiography and Ultrasound)\nRegenerative Therapies (IRAP and PRP)\nUltrasound Guided Joint Therapies\nNutritional Consultation\nShockwave Therapy\nChiropractics\n\nAcupuncture', '', 0, '2003', NULL, '', '', 'tlegaard013@gmail.com', 'approved', 0, '', 0, '2015-02-24 18:47:35', '2015-02-24 18:47:35'),
