  (10409, 2, 0, 863, 'Dr', 'Robert', 'Lewis', NULL, 'Dr. Robert Lewis is a graduate of the first veterinary medicine class from Louisiana State University in 1977. He began his career at the Elgin Veterinary Hospital and has been here ever since. Dr. Lewis was a pioneer in the development of arthroscopic surgery for horses in the early 1980?s. Dr. Lewis has participated in many professional organizations including Texas Veterinary Medical Association, American Veterinary Medical Association, Texas Horse Racing Association and American Association of Equine Practitioners (member since 1976) where he served as President from 1998 to 1999. Dr. Lewis has been a member of numerous committees including serving as the current Chairman of the Racing Medication & Testing Consortium. Dr. Lewis is also a lifetime member of the American Quarter Horse Association, Texas Quarter Horse Association, Texas Thoroughbred Association and National Cutting Horse Association. Additionally Dr. Lewis served on the Texas State Board of Veterinary Medical Examiners from 1987 until 1994. Dr. Lewis has received many honors and awards including the Texas Veterinary Medical Association Equine Practitioner of the Year in 1984, Louisiana State University School of Veterinary Medicine Distinguished Alumnus Award in 1990 (first ever recipient of this award), Texas Thoroughbred Association Man of the Year Award (twice) in 1991 and in 1992, AQHA Register of Merit Award (for service to industry) in 1990 and American Association of Equine Practitioners Distinguished Life Member Award in 2007. Dr. Lewis is renowned for his surgical skill and has extensive experience with equine orthopedic surgery including long bone fractures and arthroscopy.', '', 0, '1977', NULL, '', '', 'evhequine@yahoo.com', 'approved', 0, '', 0, '2015-03-06 13:38:11', '2015-03-06 13:38:11'),
  (10410, 2, 0, 863, 'Dr', 'Gary', 'Warner', NULL, 'Dr. Gary Warner, DVM joined Elgin Veterinary Hospital, Inc. in 1980 as an Associate Veterinarian after graduation from Louisiana State University, School of Veterinary Medicine. In 1983, Dr. Warner became a partner in the practice and is currently the Bovine/Food Animal practicing partner. Dr. Warner is licensed to practice both in Texas and Louisiana. He is also a USDA Accredited Veterinarian. Dr. Warner’s passion is his livestock and farming enterprise in Bastrop County, Texas. He is a member of many committees, including the TVMA Bovine Practice Committee where he served as chairman for 10 years. Dr. Warner has been awarded the TVMA Clinical Consultation and Referral Award, as well as, TVMA Food Animal Practitioner of the Year. Dr. Warner is world renown in the Bovine industry for his veterinary expertise and vast experience in treating bucking bulls and livestock. He also writes articles for many different publications including Bull Penmagazine and The Showbox magazine, and has recently been featured in an article in the Elgin Courier regarding his treatment of bucking bull stock.', '', 0, '1983', NULL, '', '', 'evhequine@yahoo.com', 'approved', 0, '', 0, '2015-03-06 13:40:43', '2015-03-06 13:40:43'),
